import React, { useState } from "react";
import Style from "./salesRegister.module.scss";
import {
  Title,
  FormFields,
  ColFields,
  TextArea,
  ImageSelector,
  Buttons,
} from "components/formFields";
import QRCodeGenerator from "components/qrCodeGenerator";
import veiculos from 'components/json/veiculos.json';

export default function SalesRegistration() {
  const [dados, setDados] = useState(veiculos);
  const handleChange = (e) => {
    const { name, value } = e.target;
    setDados({ ...dados, [name]: value });
  };
  return (
    <>
      <div className={Style.container}>
        <div className={Style.form__container}>
          <label className={Style.form__title__field}>
            <Title title={"Cadastro de vendas"} Style={Style} />
            <form className={Style.form__field}>
              <div className={Style.search}>
                <FormFields
                  placeholder={"Placa do veículo"}
                   value={dados.placa}
                />
              </div>
              <div className={Style.search}>
                <Buttons
                  type={"submit"}
                  variant={"outline-primary"}
                  name={"Pesquisar"}
                />
              </div>
              <div className={Style.form}>
                <FormFields disabled={true}  value={dados.nome} placeholder={"Nome do Veiculo"} />
                <FormFields disabled={true}  value={dados.marca} placeholder={"Fabricante"} />
                <FormFields disabled={true}  value={dados.modelo} placeholder={"Modelo"} />
                <FormFields disabled={true}  value={dados.ano} placeholder={"Ano"} />
              </div>
              <div className={Style.form}>
                <div className={Style.form__media}>
                  <FormFields placeholder={"Câmbio"}  value={dados.cambio}/>
                  <ColFields
                   value={dados.potencia}
                    placeholder={"Potência"}
                    Style={Style}
                    unidadeMedida={"CV"}
                  />
                </div>
                <div className={Style.form__media}>
                  <ColFields
                   value={dados.torque}
                    placeholder={"Torque"}
                    Style={Style}
                    unidadeMedida={"N.m"}
                  />
                  <FormFields placeholder={"KM"}  value={dados.km} />
                </div>
              </div>
              <div className={Style.form}>
                <FormFields placeholder={"Cor"}  value={dados.cor}/>
                <FormFields placeholder={"Cabine"}  value={dados.cabine}/>
                <FormFields placeholder={"Relação diferencial"}  value={dados.relacaoDiferencial}/>
                <FormFields placeholder={"Suspensão"}  value={dados.tipo_suspensao} />
              </div>
              <div className={Style.form}>
                <div className={Style.form__media}>
                  <FormFields placeholder={"Entre-eixos"}  value={dados.entreEixos} />
                  <ColFields
                   value={dados.CapMaxCombustivel}
                    placeholder={"Cap. máx. combustível"}
                    Style={Style}
                    unidadeMedida={"L"}
                  />
                </div>
                <ColFields
                 value={dados.valor}
                  placeholder={"Valor"}
                  Style={Style}
                  unidadeMedida={"R$"}
                />
              </div>
              <div className={Style.form__media__textarea}>
                <TextArea
                 value={dados.infoOpicionais}
                  placeholder={"Informações opcionais"}
                  label={"Informações opcionais"}
                  Style={Style}
                />
                <TextArea
                 value={dados.infoAdicionais}
                  placeholder={"Informações adicionais"}
                  label={"Informações adicionais"}
                  Style={Style}
                />
              </div>
              <div className={Style.buttons__field}>
                <ImageSelector label={"Selecionar múltiplas imagens"}  value={dados.imagem} />
                <Buttons
                  type={"reset"}
                  variant={"outline-danger"}
                  name={"Limpar"}
                />{" "}
                <Buttons
                  type={"submit"}
                  variant={"outline-success"}
                  name={"Cadastrar"}
                  onClick={console.log("Funfou")}
                />{" "}
                <QRCodeGenerator />
              </div>
            </form>
          </label>
        </div>
      </div>
    </>
  );
}
